## Flexdashboard

&lt;p style="margin-bottom: -85px;"&gt; &amp;nbsp; &lt;/p&gt;

Un **dashboard** es como un _resumen_ empleado para mejorar la
toma de decisiones, cuyo objetivo es **transformar data en información**.

En un **dashboard** se recopilan datos y estos se presentan de manera 
concisa para resaltar lo más importante que deducimos a partir
de aquella información.

Ejemplos de
[proyectos](https://rstudio.github.io/flexdashboard/articles/examples.html)
realizados con el paquete flexdashboard.

&gt; Ok ok ... pero ... ¿de dónde viene el _flex_?

El paquete **flexdashboard** emplea la propiedad
&amp;nbsp;`display: flex`&amp;nbsp; de **CSS** para alterar 
el ancho y altura de ciertos elementos de la página con el fin de 
llenar _lo mejor posible_ el espacio disponible en 
la pantalla del dispositivo.

&lt;p style="margin-bottom: -30px;"&gt; &amp;nbsp; &lt;/p&gt;

## Instalación

&lt;p style="margin-bottom: -85px;"&gt; &amp;nbsp; &lt;/p&gt;

```r
install.packages('flexdashboard')
```

---
class: middle

## Encabezado YAML básico de proyecto flexdashboard

```yaml
---
title: Proyecto con flexdashboard
output:
  flexdashboard::flex_dashboard:
    orientation: columns  # rows
    vertical_layout: fill # scroll
---
```

&lt;p style="margin-bottom: -35px;"&gt; &amp;nbsp; &lt;/p&gt;

### `orientation` 

Establece si añadimos secciones (al dashboard )
por columnas o por filas.

&lt;p style="margin-bottom: -35px;"&gt; &amp;nbsp; &lt;/p&gt;

### `vertical_layout`

Con `fill`, los gráficos se autoajustan para cubrir toda la
pantalla; pero, con `scroll`, los gráficos preservan su 
altura natural, y la página permitirá desplazarse verticalmente
_fuera de la pantalla_.

&lt;p style="margin-bottom: -85px;"&gt; &amp;nbsp; &lt;/p&gt;

## Customización de la barra de navegación

```yaml
output: 
  flexdashboard::flex_dashboard:
    favicon: favicon.ico # También puede ser .png .
    logo: logo.png       # La imagen no será reescalada.
    social:
      - twitter
      - facebook
      - google-plus
      - linkedin
      - pinterest
      - menu     # contiene todas las redes sociales disponibles por default
    navbar:
      - title: "About"
        icon: far fa-folder-open  # misma manera que se definen en _site.yml
        href: "temporal.html" # https://www.google.com
        align: left # right
```

???

El logo debería tener 48 pixels de altura para que "se vea bien" en el barra 
de navegación de la plantilla "cosmo", pero 
**otras plantillas podrían tener distintas alturas para la barra de navegación.**

## htmlwidgets

Este paquete de **R** nos permite emplear directamente en **R**
(y **R Markdown** ) librerías de **JavaScript** especializadas
en visualización de datos.

Asimismo, la librería **htmlwidgets** nos da la posibilidad
de crear nuestro propio **widget** para poder emplear vía **R** 
alguna librería de **JavaScript** de nuestro interés.

En esta sesión, trabajaremos con solo algunas de las 
librerías de **JavaScript** que el paquete **htmlwidgets** 
nos facilita utilizar en **R**.




???

- Ejecutar los htmlwidgets en un archivo **.R** por separado.

- Instalar el paquete `tidyverse`.

```r
accumulate_by &lt;- function(dat, var) {
  var &lt;- lazyeval::f_eval(var, dat)
  lvls &lt;- plotly:::getLevels(var)
  dats &lt;- lapply(seq_along(lvls), function(x) {
    cbind(dat[var %in% lvls[seq(1, x)], ], frame = lvls[[x]])
  })
  dplyr::bind_rows(dats)
}

iris2 &lt;- iris
iris2$indices &lt;- 1:nrow(iris2)

iris2 %&gt;%
  accumulate_by(~indices) %&gt;%
  plot_ly(
    x = ~indices, 
    y = ~Sepal.Length,
    frame = ~frame, 
    type = 'scatter',
    mode = 'lines' # unir vía líneas los puntos consecutivos del gráfico
) %&gt;%
  animation_opts(
    frame = 50, 
    transition = 0,
    redraw = FALSE # dibujar el gráfico tras cada transición
)
```

## visNetwork



&lt;p style="margin-bottom: -3%;"&gt; &amp;nbsp; &lt;/p&gt;

.panelset.sideways[

.panel[.panel-name[Configuración]
Tutoriales:&lt;br&gt;
- &lt;https://datastorm-open.github.io/visNetwork/&gt;
- &lt;https://cran.r-project.org/web/packages/visNetwork/vignettes/Introduction-to-visNetwork.html&gt;

Listado de funciones:&lt;br&gt;
&lt;https://cran.r-project.org/web/packages/visNetwork/visNetwork.pdf&gt;

```r
install.packages('visNetwork')
library(visNetwork)
```
]

.panel[.panel-name[Ejemplo 1]

```r
vertices &lt;- data.frame(id = 1:4, 
                  shape = c("circle", "square"), 
                  label = LETTERS[1:4])
aristas &lt;- data.frame(from = c(2,4,3,3), to = c(1,2,4,2))

visNetwork(vertices, aristas, width = "100%") %&gt;% 
      visNodes(color = list(background = "lightblue", 
                            border = "darkblue",
                            highlight = "yellow"),
               shadow = list(enabled = TRUE, size = 10))  %&gt;%
      visLayout(randomSeed = 12) # para tener siempre el mismo grafo   
```
]

.panel[.panel-name[Ejemplo 2]

```r
aristas &lt;- data.frame(from = c(2,3,5,7), to = c(1,4,6,10),
                      length = c(100,250,500,700),
                      width = c(1,2,3,5),
                      arrows = c("to", "from", "to;from", "to"),
                      dashes = c(TRUE, FALSE, TRUE, FALSE),
                      smooth = c(FALSE, TRUE, FALSE, TRUE),
                      shadow = c(FALSE, TRUE, FALSE, TRUE)
) 

vertices &lt;- data.frame(id = 1:6, label=LETTERS[1:6], group = c("Y", "N"))
visNetwork(vertices, aristas, height = "500px", width = "100%") %&gt;%
  visLayout(randomSeed = 42)
```
]

.panel[.panel-name[Ejemplo 3]

&lt;https://datastorm-open.github.io/visNetwork/image_icon.html&gt;


```r
vertices &lt;- data.frame(id = 1:3, group = c("B", "A", "B"))
aristas &lt;- data.frame(from = c(1,2), to = c(2,3))

visNetwork(vertices, aristas, width = "100%") %&gt;%
  visGroups(groupname = "A", shape = "icon", 
            icon = list(code = "f0c0", size = 75)) %&gt;%
  visGroups(groupname = "B", shape = "icon", 
            icon = list(code = "f007", color = "red")) %&gt;%
  addFontAwesome()
```
]


.panel[.panel-name[Ejemplo 4]


```r
vertices &lt;- data.frame(id = 1:7)
aristas &lt;- data.frame(from = c(1,2,2,2,3,3),
                      to = c(2,3,4,5,6,7)
)

visNetwork(vertices, aristas, width = "100%") %&gt;% 
  visEdges(arrows = "middle") %&gt;% 
  visHierarchicalLayout()
```
]

.panel[.panel-name[Ejemplo 5]

```r
vertices &lt;- data.frame(id = 1:50)
aristas &lt;- data.frame(from = sample(1:50, 100, replace = TRUE),
                      to = sample(1:50, 100, replace = TRUE)
)

visNetwork(vertices, aristas, width= "100%") %&gt;%
  visIgraphLayout(layout = "layout_in_circle") %&gt;%
  visNodes(size = 10)
```
]
]

```r
library(maps)
library(maptools)

data(world.cities, package="maps")
ciudades &lt;- world.cities[order(world.cities$pop,decreasing=TRUE)[1:1000],]

globejs(bg = "white", 
        lat=ciudades$lat,   # latitud
        long=ciudades$long, # longitud
        value = 100*(ciudades$pop/max(ciudades$pop)), # alturas para los valores
        rotationlat = -0.34, # Rotación latitudinal inicial (en radianes) del globo
        rotationlong =-0.38, # Rotación longitudinal inicial (en radianes) del globo
        fov = 30 # Campo de visión (field of view) inicial
)
```

.panel[.panel-name[Ejemplo 1]

### Gráfico de dispersión


```r
*close3d()
*open3d()

numero_puntos &lt;- 12*25
x &lt;- sort(rnorm(numero_puntos))
y &lt;- rnorm(numero_puntos)
z &lt;- rnorm(numero_puntos) + atan2(x,y)

points3d(x, y, z, col = rainbow(numero_puntos))
# lines3d(x, y, z, col = rainbow(numero_puntos))
# segments3d(x, y, z, col = rainbow(numero_puntos))
# triangles3d(x, y, z, col = rainbow(numero_puntos))
# quads3d(x, y, z, col = rainbow(numero_puntos))

*rglwidget()
```


```r
close3d()
open3d()

plot3d(x, y, z, col = rainbow(numero_puntos))
rglwidget()
```

]

.panel[.panel-name[Ejemplo 2]

### Customización gráfica


```r
close3d()
open3d()

triangles3d(x, y, z, col = rainbow(numero_puntos))
axes3d(tick = TRUE, nticks = 10)

# Añadir algunas propiedades al gráfico 3D
decorate3d(   
  main = "Título",
  box = TRUE, # Dibujar caja alrededor del gráfico
  expand = 1.25, # Cuánto expandir la caja (si se dibuja) respecto al gráfico
  aspect = c(0.5,1,1.5) # aspect ratio de los ejes
)
bg3d("#92E3ED") # color de fondo

rglwidget(elementId = "ejemplo-2")
```
]

.panel[.panel-name[Ejemplo 3]

### Superficies de revolución


```r
close3d()
open3d()

x &lt;- seq(from=1, to=5, by=0.5)
y &lt;- log(x)

*wire3d(turn3d(x, y, n = 20, smooth = FALSE))
# shade3d(turn3d(x, y, n = 20, smooth = TRUE), col="green")
# dot3d(turn3d(x, y, n = 20, smooth = FALSE), col="#EA42FF")

rglwidget()
```


```r
close3d()
open3d()

shade3d(turn3d(x, y, n = 20, 
               smooth = TRUE # Renderización gráfica más "suave"
               ),
        col="green"
)

rglwidget()
```

.panel[.panel-name[Ejemplo 4]

### Animación de curva respecto al tiempo


```r
close3d()
open3d()
```

```
## null 
##    5
```

```r
library(manipulateWidget) # instalarla si es necesario

tiempo &lt;- 0:500
xyz &lt;- data.frame(
            x = cos(tiempo/20),
            y = sin(tiempo/10),
            z = tiempo
)
id_curva &lt;- plot3d(xyz, type="l")["data"]  # curva por trazar
id_esfera &lt;- spheres3d(xyz[1,],      # este valor no importa, 
                                     # se reemplaza al iniciar la animación
                      radius = 8,    # radio de la esfera graficada
                      col = "purple" # color de la esfera graficada
)

rglwidget(elementId = "curva-parametrizada") %&gt;%
  playwidget(list(
    ageControl(births = tiempo, # Frames en los cuales la gráfica se actualizará
              ages = c(
                        0,  # Al inicio del frame del frame actual
                        20, # Tras 20 frames del frame actual
                        50  # Tras 50 frames del frame actual
                      ),
              colors = c(
                          "green", # Color de vértice tras transcurrir 0 frames
                          "red",   # Color de vértice tras transcurrir 20 frames
                          "blue"   # Color de vértices tras transcurrir 100 frames
                        ), 
              objids = id_curva # Identificador que será actualizado via "colors",
                                # en este caso, la curva graficada.
    ),
    
    ageControl(births = 0,        # Actualizaciones iniciarán en el primer frame
              ages = tiempo,      # Tras aquellas cantidad de frames (n-ésimo frame),
              vertices = xyz,     # actualizar el gráfico con el n-ésimo vértice.
              objids = id_esfera) # Las actualizaciones serán para el
                                  # gráfico de una esfera (en posiciones distintas)
              ),

    start = 0, stop = max(tiempo), # cantidad de frames por considerar en la animación
    rate = 50, # cantidad de frames por segundo
    components = c("Reverse", "Play", "Slower", "Faster","Reset", "Slider", "Label"),
    loop = TRUE # Repetir la animación cuando concluya.
  )
```

### Combinando rgl y JavaScript

```js
////// Código de JavaScript //////
rgl = document.getElementById('curva-parametrizada').rglinstance;
rglObject = rgl.getObj(rgl.subsceneid); 

//// Ejemplo particular: Rotaciones ////
angulo = 10;

// Una rotación respecto al eje X
rglObject.par3d.userMatrix.rotate(angulo, 0, 1, 0);
rgl.drawScene();

// Una rotación respecto al eje Y
rglObject.par3d.userMatrix.rotate(angulo, 1, 0, 0);
rgl.drawScene();

// Iniciar rotación constante respecto al eje X 
let rotaX = setInterval(
  function () {
    rglObject.par3d.userMatrix.rotate(angulo, 0, 1, 0);
    rgl.drawScene();
  }
, 200);

// Iniciar rotación constante respecto al eje Y 
let rotaY = setInterval(
  function () {
    rglObject.par3d.userMatrix.rotate(angulo, 1, 0, 0);
    rgl.drawScene();
  }
, 200);

// Detener alguna rotación
clearInterval(rotaX);
clearInterval(rotaY);
```

Para el ejemplo 5:

Alterar los siguientes valores asociados al gráfico:&lt;br&gt;
- Ejemplo raro probablemente sin mucha utilidad
    - `rgl.colLoc = 0` 1, 2 o 3 (mismo resultado que 3 para valores &gt;=3)
    - `rgl.drawScene()` 

- Cambiar color de los valores en los ejes
    - `rgl.canvas.style.backgroundColor = "blue"` 

- Modificar tamaño de la caja contenedora:
    - `rglObject.par3d.bbox[some_index] = some_number`
    - `rgl.drawScene()` 

- Alterar el nivel de zoom
    - `rglObject.par3d.FOV = 10`
    - `rglObject.par3d.zoom = 0.5` 

- Cambiar las escalas de los ejes
    - `rglObject.par3d.scale` 
    - Para proyectar el gráfico sobre el eje XY:&lt;br&gt;
    `rglObject.par3d.scale[2]=0`&lt;br&gt;
    Requiere después hacer click en la figura para proyectarse.

- Proyección (creo) respecto a los planos de R^3
    - XY: `rglObject.par3d.userMatrix.scale(0,1,1)` 
    - XZ: `rglObject.par3d.userMatrix.scale(1,1,0)`

- Rotación
    - `rglObject.par3d.userMatrix.rotate(angulo_en_grados,x,y,z)`

<script>
    // Chage color of slide-number-sections if there are comments in such slide
    document.addEventListener('DOMContentLoaded', function () {
      let notes = document.querySelectorAll('div.remark-slide-container > div.remark-slide-notes');
      notes = Array.prototype.slice.call(notes);

      // For some reason, there is "repetition" of divs with the same comments ... delete delete
      notes.splice(notes.length - 1,1);
      notes.splice(notes.length/2, notes.length/2);

      // Only work with the slides that had comments inserted via R Markdown
      notes = notes.filter(note => note.childElementCount > 0);

      // Work with the actual divs that contain the slide-number
      notes = notes.map(note => note.parentNode.firstChild.firstChild.firstChild.lastChild);

      // Change color of text in slide-number divs
      notes.forEach(note => note.style.color = "red");
    });

    // Code to fix the change of slide when scrolling and when clicking some elements
    let touchmoved;
    $('div.remark-slide-container').on('touchend', function(event){
        if(touchmoved === true) {
            // Do not change slide if scrolling took place
            event.preventDefault(); 
            event.stopPropagation();
        } else {
            // Fix for issue when clicking an image with an anchor
            if(event.target.tagName === "IMG") {
                if (event.target.parentNode.getAttribute("href").includes("https:")) {
                    // If there was no scrolling and the user clicked on an image
                    // which has an anchor, then do not change slide and open
                    // in a next window the site linked to image touched
                    event.preventDefault(); 
                    event.stopPropagation();
                    window.open(event.target.parentNode.getAttribute("href"));
                } 
            }
            
            // Fix for issue when clicking the symbol of a <details><summary> ...
            if (event.target.tagName === "SUMMARY") {
                if(event.target.parentNode.tagName === "DETAILS") {
                    event.preventDefault();
                    event.stopPropagation();
                    // Manually toggle between open or closed <details>
                    if(event.target.parentNode.open === true) {
                        event.target.parentNode.open = false;
                    } else {
                        event.target.parentNode.open = true;
                    }
                }
            }
        }
    }).on('touchmove', function(){
        touchmoved = true;
    }).on('touchstart', function(){
        touchmoved = false;
    });

    //// Code to chage between slides depending on user screen swipe ////
    // Such option is supossed to work already in Xaringan, but it was not working for me :(
    let touchstartX = 0;
    let touchendX = 0;
    let swiped = false;

    function conditional_swipe() {
        // Swiped left
        if (touchendX < touchstartX) {
            if ( (touchstartX - touchendX) > (screen.availWidth)*0.25 ) slideshow.gotoNextSlide();
        } else {
            // Swiped right, because swiped equals true
            if ( (touchendX - touchstartX) > (screen.availWidth)*0.25 ) slideshow.gotoPreviousSlide();
        }
    }
        
    $('div.remark-slide-container').on('touchstart', event => {
        touchstartX = event.changedTouches[0].screenX;
        swiped = false;
    });

    $('div.remark-slide-container').on('touchmove', function() { swiped = true; });

    $('div.remark-slide-container').on('touchend', event => {
        touchendX = event.changedTouches[0].screenX;
        if (swiped === true) conditional_swipe();
    });

<script>
  ////  Creation of a table of contents for Xaringan  ////
  let body;
  let slidesParent, slides, headers;
  let slidesHeaders = [];
  let helpMenu;
  let toc, tocDiv, tocTitle;
  
  let resizeSlides; // variable for manual slide resize (different than slides variable)

  document.addEventListener('DOMContentLoaded', function() {
    // Set variables
    body = document.querySelector('body');
    helpMenu = document.querySelector('div.remark-help');
    helpMenu.setAttribute('style','overflow: auto;'); // Show all keyboard commands for Xaringan
    slidesParent = document.querySelector('div.remark-slides-area');

    ////////////////////////////////////////////////////////////////////
    //// Remove the headers which have been set not be added to TOC ////

    // Important to search for headers only in div.remark-slides-area, 
    // because, if not, there are  headers that get added more than once to the variable "headers"
    headers = document.querySelectorAll('div.remark-slides-area h1, div.remark-slides-area h2, div.remark-slides-area h3, div.remark-slides-area h4, div.remark-slides-area h5, div.remark-slides-area h6');

    // Convert some variables to arrays
    headers = Array.prototype.slice.call(headers);
    slides = Array.prototype.slice.call(slidesParent.children);

    // Remove the header h1 "Help" from the Xaringan menu
    for (let i =0; i< headers.length; i++){
      if(headers[i].classList.length === 0 && headers[i].textContent === 'Help'){
        headers.splice(i,1);
      }
    }

    // Remove headers with class "no-toc"
    headers = headers.filter(header => !( header.classList.contains('no-toc') ));
    
    // Remove headers which were applied ".no-toc[ some_header ]" in the R Markdown code
    headers = headers.filter(header => !( header.parentNode.classList.contains('no-toc') && header.parentNode.tagName==='DIV'));

    // Remove headers contained in a slide to which "class: no-toc" was applied
    headers = headers.filter( (header) => {
      let temporal = getDivSlideContainer(header).firstChild.firstChild.firstChild;
      // Check that the child chosen is the div with class "remark-slide-content",
      // the one to which the class "no-toc" would be added if "class: no-toc" was used
      if ( temporal.classList.contains('remark-slide-content') && temporal.tagName === 'DIV' ) {
        if( temporal.classList.contains('no-toc') ){
          // Remove this header
          return false;
        } else {
          // Do not remove this header
          return true;
        }
      }
    });
    ////////////////////////////////////////////////////////////////////

    // Group headers via the slide they belong to
    for(let i=0; i < slides.length; i++){
      let temporal = headers.filter(header => slides.indexOf(getDivSlideContainer(header)) === i);
      if (temporal.length > 0){
        slidesHeaders.push({ 
          key: i,
          value: temporal
        });
      }  
    }

    // Create an ordered list via slidesHeaders variable
    tocDiv = document.createElement('div');
    tocDiv.id = "toc-container";

    tocTitle = document.createElement('p');
    tocTitle.textContent = "Table of contents";
    tocDiv.append(tocTitle);
    tocDiv.append(document.createElement('hr'));

    toc = document.createElement('ol');
    toc.id = "xaringan-toc";
    tocDiv.append(toc);
    slidesHeaders.forEach( (element) => {
      element.value.forEach( (header) => {
        let tocItem = document.createElement('li');
        let anchor = document.createElement('a')
        // Insert header name
        anchor.innerHTML = header.textContent;
        // Pass info about header's slide container
        anchor.setAttribute('data-slide',element.key)
        
        // Add header item to table of contents
        toc.append(tocItem);
        tocItem.append(anchor);
        
      })
    });


    ////////////////////////////////////////////////////////////
    //// Set default stylings via JavaScript instead of CSS ////
  
    // Insert tocDiv in page (but hide it), to set its styles
    body.append(tocDiv);

    document.querySelector('html').setAttribute('style',"scroll-behavior: smooth;");
    document.querySelector('#toc-container').setAttribute('style',"padding: 0; float: left; z-index: 100; position: absolute; bottom: 0; left: 0; display: block; border: 2px solid black; background-color: #F0F0F0; overflow: auto; min-width: 10vw;  height: 50vh; resize: horizontal;");
    // Hide table of contents
    tocDiv.style.display = "none";

    document.querySelector('#toc-container p').setAttribute('style',"font-size: 17px; margin-top: 8px; text-align: center; margin-bottom: -10px;");
    document.querySelector('#toc-container hr').setAttribute('style',"border: 0.1px solid gainsboro; width: 90%;");
    document.querySelector('#xaringan-toc').setAttribute('style',"margin: 0; padding: 5px 30px 10px 40px;");
    
    // Style properties for anchors of table of contents
    let css = "#xaringan-toc li a { cursor: pointer; color: blue; transition: all 260ms linear; }"+"\n"+"#xaringan-toc li a:hover { color: red; text-decoration: underline; }";
    let style = document.createElement('style');
    if (style.styleSheet) {
        style.styleSheet.cssText = css;
    } else {
        style.appendChild(document.createTextNode(css));
    }
    document.querySelector('head').appendChild(style);
    ////////////////////////////////////////////////////////////


    // Pres key t to display Table of Contents
    document.addEventListener('keydown', function(event) {
      if (event.key === 'd') {
        if (event.repeat) {
          return;
        }

        // Update opacity, line-through and font-weight of toc's anchors
        updateTocAnchorsStyle();

        //// Best alternative I've found so far to insert table of contents ////
        // slides[slideshow.getCurrentSlideIndex()].children[0].append(tocDiv);
        // Such alternative has the issue that sometimes double the key press
        // is required in order to show de TOC, due to it being "hidden"
        // after changing slide from a slide where the TOC was displayed.
        
        // Default toc stylings
        tocDiv.style.top = '';
        tocDiv.style.width = 'auto';
        tocDiv.style.height = '50vh';

        if(tocDiv.style.display === 'block') {
          tocDiv.style.display = 'none';
        } else {
          tocDiv.style.display = 'block';
          // Insert table of contents on page
          body.append(tocDiv);
        }
      }
    });

    // Make anchors in Table of Contents activate appropriate slide change when clicked
    toc.children.forEach( (item) => {
      item.firstChild.addEventListener('click', function(event) {
        // Go to appropriate slide
        slideshow.gotoSlide(1+parseInt(this.dataset.slide));

        // Close and open table of contents in order to activate
        // line-through and opacity change of previous anchors
        switch (tocDiv.style.height) {
          case '100vh':
            document.dispatchEvent(new KeyboardEvent('keydown',{'key':'e'}));
            document.dispatchEvent(new KeyboardEvent('keydown',{'key':'e'}));
            break;
          default:
            // We assume the height is either 50vh or some custom one aparat from 100vh
            document.dispatchEvent(new KeyboardEvent('keydown',{'key':'d'}));
            document.dispatchEvent(new KeyboardEvent('keydown',{'key':'d'}));
            break;
        }

        // Scroll the table of contents to the anchor just clicked
        this.scrollIntoView();
      })
    });

    // Press s in order to stick table of contents to the left empty side
    // of Xaringan slides, if there is any such empty space
    document.addEventListener('keydown', function() {
      if (event.key === 'e') {
        if (event.repeat) {
          return;
        }

        // Update opacity, line-through and font-weight of toc's anchors
        updateTocAnchorsStyle();

        // Check if there is empty space where to insert the toc
        let someSlide = document.querySelector('div.remark-slide-scaler');
        if (parseInt(someSlide.style.left.slice(0,-2)) === 0) {
        } else {
          tocDiv.style.width = String(Math.round(parseInt(someSlide.style.left.slice(0,-2))*1))+'px';
          tocDiv.style.height = '100vh';
          tocDiv.style.top = '0';
        }

        if(tocDiv.style.display === 'block') {
          tocDiv.style.display = 'none';
        } else {
          tocDiv.style.display = 'block';
          // Insert table of contents on page
          body.append(tocDiv);
        }
      }
    });

    // Select the slide divs which set the slide dimensions
    resizeSlides = slides.map(slide => slide.firstChild);
    resizeSlides.forEach(slide => slide.style.resize = "horizontal");

    resizeSlides.forEach( (slide) => {
      new ResizeObserver(resizeAllSlides).observe(slide);
    });

    // In the Help menu, show descriptions of the commands added
    let newCommandsKeys = [["e","Show TOC with height equal to the page's"],
                           ["d","Show TOC with half the page's height"],
                           ["r","Move all the slides to the right side of the page"]
                          ];
    newCommandsKeys.forEach( (commandInfo) => {
      let tableRow =  document.createElement('tr');
      let tableData = document.createElement('td');
      let newCommandKey = document.createElement('span');
      newCommandKey.className = "key";
      newCommandKey.textContent = commandInfo[0];
      let commandAction = document.createElement('td');
      commandAction.textContent = commandInfo[1];
      // Append (as in the Help menu structure) the elements created
      tableData.appendChild(newCommandKey);
      tableRow.appendChild(tableData);
      tableRow.appendChild(commandAction);
      // Append new command info to Help menu
      document.querySelector('div.remark-help table tbody').appendChild(tableRow);
    });

  });

  function getDivSlideContainer(header) {
    let temporal = header;
    while (! temporal.parentNode.classList.contains('remark-slide-container')) {
      temporal = temporal.parentNode;
    }
    return temporal.parentNode;
  }

  function pushSlidesToRight() {
    // Get real width of current slide and push slide to the right of screen
    let temporal = screen.availWidth - resizeSlides[slideshow.getCurrentSlideIndex()].getBoundingClientRect().width ;
    resizeSlides.forEach(slide => { slide.style.left = String(Math.round(temporal))+'px'; });

    // Close and open table of contents in order to fix width
    if ( tocDiv.style.height === '100vh') {
      document.dispatchEvent(new KeyboardEvent('keydown',{'key':'e'}));
      document.dispatchEvent(new KeyboardEvent('keydown',{'key':'e'}));
    }
  }

  document.addEventListener('keydown', function(event) {
    if (event.key === 'r') {
        if (event.repeat) {
          return;
        }
        pushSlidesToRight();
    }
  });

  function resizeAllSlides() {
    let currentSlide = resizeSlides[slideshow.getCurrentSlideIndex()];
    resizeSlides.forEach(slide => { 
      // slide.style.width = String(Math.round(currentSlide.getBoundingClientRect().width))+'px';
      slide.style.width = String(currentSlide.offsetWidth) + 'px';
    });
  }

  $(document).on('webkitfullscreenchange mozfullscreenchange fullscreenchange MSFullscreenChange', async function() {
    // Whenever a change from or to fullscreen window occurs,
    // wait a while (because slides take a little time to get resized)
    // and do the following:

    await sleep(200);

    // Resize the toc even if it was not open during this event
    if (tocDiv.style.height === '100vh') {
      document.dispatchEvent(new KeyboardEvent('keydown',{'key':'e'}));
      document.dispatchEvent(new KeyboardEvent('keydown',{'key':'e'}));
    } else {
      document.dispatchEvent(new KeyboardEvent('keydown',{'key':'d'}));
      document.dispatchEvent(new KeyboardEvent('keydown',{'key':'d'}));
    }
  });

  function updateTocAnchorsStyle() {
    // Update opacity, line-through and font-weight of toc's anchors
    let currentSlide = slideshow.getCurrentSlideIndex();
    toc.children.forEach( (element) => {
      if ( currentSlide > 0 ) {
        if ( parseInt(element.firstChild.dataset.slide) < currentSlide ) {
          element.firstChild.style.opacity = 0.5;
          element.firstChild.style.fontWeight = 400;
          element.firstChild.style.textDecoration = "line-through";
        } else {
          if ( parseInt(element.firstChild.dataset.slide) === currentSlide ) {
            element.firstChild.style.opacity = 1;
            element.firstChild.style.fontWeight = 900;
            element.firstChild.style.textDecoration = "";
          } else {
            element.firstChild.style.opacity = 1;
            element.firstChild.style.fontWeight = 400;
            element.firstChild.style.textDecoration = "";

          }
        }
      } else {
        // Currrent slide is the first one, so undo anchor style changes
        element.firstChild.style.opacity = 1;
        element.firstChild.style.fontWeight = 400;
        element.firstChild.style.textDecoration = "";
        
        // Bold anchors from first slide
        if (element.firstChild.dataset.slide === '0') {
          element.firstChild.style.fontWeight = 900;
        }
      }
    });
  }

  // Refresh toc after a slide change
  slideshow.on('afterShowSlide', async function() {
    // Wait some time so that the new slide index gets recognized
    await sleep(100);

    // Update the style of the table of contents' anchors
    updateTocAnchorsStyle();
  });

  // Define the standard sleep() function
  function sleep(miliseconds) {
    return new Promise(resolve => setTimeout(resolve, miliseconds));
  }
</script>

<script>
slideshow._releaseMath = function(el) {
  var i, text, code, codes = el.getElementsByTagName('code');
  for (i = 0; i < codes.length;) {
    code = codes[i];
    if (code.parentNode.tagName !== 'PRE' && code.childElementCount === 0) {
      text = code.textContent;
      if (/^\\\((.|\s)+\\\)$/.test(text) || /^\\\[(.|\s)+\\\]$/.test(text) ||
          /^\$\$(.|\s)+\$\$$/.test(text) ||
          /^\\begin\{([^}]+)\}(.|\s)+\\end\{[^}]+\}$/.test(text)) {
        code.outerHTML = code.innerHTML;  // remove <code></code>
        continue;
      }
    }
    i++;
  }
};
slideshow._releaseMath(document);
</script>
